import { Component, OnInit } from '@angular/core';
import { MapService } from './service/map.service';
import { AdventureService } from '../adventurer/service/adventurer.service';

@Component({
  selector: 'app-map',
  templateUrl: './map.component.html',
  styleUrls: ['./map.component.css']
})
export class MapComponent implements OnInit {

  map!: any[][];
  adventurers!: any[];

  constructor(
    private mapService: MapService,
    private adventureService: AdventureService
  ) { }

  getCellStyle(cell: any, x: number, y: number) {
    if (this.adventurers.some(a => a.x === x && a.y === y)) {
      return 'adventurer';
    } else if (cell === 'P') {
      return 'plain';
    } else if (cell === 'M') {
      return 'mountain';
    } else if (cell.type === 'T') {
      return 'treasure';
    }

    return '';
  }

  ngOnInit(): void {
    this.mapService.map$.subscribe(map => this.map = map);
    this.adventureService.adventurers$.subscribe(adventurers => {
      this.adventurers = adventurers;
    });
  }

}
<div role="grid">
    <div *ngFor="let row of map; let y = index" role="row">
        <div
            *ngFor="let cell of row; let x = index"
            [ngClass]="getCellStyle(cell, x, y)"
            role="cell"
        >
            <div *ngIf="cell === 'P'">.</div>
            <div *ngIf="cell === 'M'">M</div>
            <div *ngIf="cell?.type === 'T'">T({{ cell.treasures }})</div>
            <div *ngFor="let adventurer of adventurers">
                <div *ngIf="adventurer.x === x && adventurer.y === y">
                    {{ adventurer.name }}
                    <span *ngIf="adventurer.orientation === 'N'">&uarr;</span>
                    <span *ngIf="adventurer.orientation === 'S'">&darr;</span>
                    <span *ngIf="adventurer.orientation === 'E'">&rarr;</span>
                    <span *ngIf="adventurer.orientation === 'W'">&larr;</span>
                </div>
            </div>
        </div>
    </div>
</div>
